var title_f9_58_10145="Insulin injection PI";
var content_f9_58_10145=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PI%2F80789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PI%2F80789&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    How to give an insulin shot",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 354px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <ol>",
"     <li>",
"      Pinch up some skin and quickly insert the needle at a 90&deg; angle (or whatever angle your doctor or nurse tells you). Keep the skin pinched to avoid having the insulin go into the muscle.",
"     </li>",
"     <li>",
"      Push the plunger down all the way. Hold the syringe and needle in place for 5 seconds.",
"     </li>",
"     <li>",
"      Let go of the pinched skin and remove the needle from the skin. If you see blood or clear fluid (insulin) where the needle went in, press on the area for 5 to 8 seconds, but do not rub.",
"     </li>",
"    </ol>",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
