"      Miles MV, Tennison MB, and Greenwood RS, &ldquo;Pharmacokinetics of N-desmethylmethsuximide in Pediatric Patients,&rdquo;",
"      <i>",
"       J Pediatr",
"      </i>",
"      , 1989, 114(4 Pt 1):647-50.",
"      <span class=\"pubmed-id\">",
"       [PubMed",
"       <a href=\"mobipreview.htm?9/58/10149/abstract-text/2926578/pubmed\" id=\"2926578\" target=\"_blank\">",
