var title_f9_58_10153="Anisakiasis life cycle";
var content_f9_58_10153=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F76409&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F76409&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 535px\">",
"   <div class=\"ttl\">",
"    Anisakiasis life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 515px; height: 586px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Adult stages of",
"    <em>",
"     Anisakis simplex",
"    </em>",
"    or",
"    <em>",
"     Pseudoterranova decipiens",
"    </em>",
"    reside in the stomach of marine mammals, where they are embedded in the mucosa, in clusters. Unembryonated eggs produced by adult females are passed in the feces of marine mammals",
"    <strong>",
"     (1)",
"    </strong>",
"    . The eggs become embryonated in water, and first-stage larvae are formed in the eggs. The larvae molt, becoming second-stage larvae",
"    <strong>",
"     (2a)",
"    </strong>",
"    , and after the larvae hatch from the eggs, they become free-swimming",
"    <strong>",
"     (2b)",
"    </strong>",
"    . Larvae released from the eggs are ingested by crustaceans",
"    <strong>",
"     (3)",
"    </strong>",
"    . The ingested larvae develop into third-stage larvae that are infective to fish and squid",
"    <strong>",
"     (4)",
"    </strong>",
"    . The larvae migrate from the intestine to the tissues in the peritoneal cavity and grow up to 3 cm in length. Upon the host's death, larvae migrate to the muscle tissues, and through predation, the larvae are transferred from fish to fish. Fish and squid maintain third-stage larvae that are infective to humans and marine mammals",
"    <strong>",
"     (5)",
"    </strong>",
"    . When fish or squid containing third-stage larvae are ingested by marine mammals, the larvae molt twice and develop into adult worms. The adult females produce eggs that are shed by marine mammals",
"    <strong>",
"     (6)",
"    </strong>",
"    . Humans become infected by eating raw or undercooked infected marine fish",
"    <strong>",
"     (7)",
"    </strong>",
"    . After ingestion, the anisakid larvae penetrate the gastric and intestinal mucosa, causing the symptoms of anisakiasis.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Anisakiasis. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Anisakiasis.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Anisakiasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
