var title_f9_58_10157="Management of short bowel syndrome in children";
var content_f9_58_10157=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72657&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72657&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of short bowel syndrome in infants and children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Clinical issue",
"       </td>",
"       <td class=\"subtitle1\">",
"        Management/comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Assess likelihood of resuming an oral diet",
"       </td>",
"       <td>",
"        Increased likelihood of resuming oral diet&nbsp;if the colon is&nbsp;intact, or if the remaining bowel segment is long.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        May take months to years, depending on the pace of intestinal adaptation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Anticipate consequences based upon remaining intestinal segments",
"       </td>",
"       <td>",
"        <span style=\"line-height: 115%; font-family: calibri,sans-serif; font-size: 11pt;\">",
"         The proximal small intestine is normally responsible for absorption of proteins and carbohydrates. However, after adaptation the ileum is able to perform these functions.",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         The distal ileum is responsible for absorption of vitamin B12 and bile salts. In general, in adults:",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;&nbsp;&nbsp; &lt;100 cm of distal ileum resected causes moderate bile salt malabsorption, so that&nbsp;bile salts&nbsp;enter the colon and cause secretory diarrhea (choleretic enteropathy)",
"        </p>",
"        <p>",
"         &nbsp;&nbsp;&nbsp; &gt;100 cm of distal ileum resected&nbsp;causes&nbsp;severe bile salt malabsorption, leading to&nbsp;an inadequate bile salt pool and&nbsp;fat malabsorption.",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Loss of the colon in combination with extensive small bowel resection&nbsp;is poorly tolerated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Early management",
"       </td>",
"       <td>",
"        Fluid and electrolyte replacement predominates.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Begin enteral feeding once patient stabilizes. Initially use breast milk or&nbsp;a hypoallergenic (semi-elemental)&nbsp;formula if the patient is younger than one year of age.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Antidiarrheal&nbsp;(antimotility) agents may&nbsp;be useful,&nbsp;unless bacterial overgrowth is present.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Enteral nutrition",
"       </td>",
"       <td>",
"        Continuous enteral feeding or small frequent feedings is preferred. Continuous feeding takes full advantage of absorptive surface area and may facilitate intestinal adaption.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Advance feeds slowly and taper parenteral nutrition. We initiate feeds by providing approximately 5 percent of total daily caloric need,&nbsp;then make&nbsp;slow incremental advances every three to seven days as tolerated.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <span style=\"line-height: 115%; font-family: calibri,sans-serif; font-size: 11pt;\">",
"         The most useful index of carbohydrate malabsorption is stool output. Carbohydrate malabsorption can also be confirmed by testing the stool for glucose (Clinitest tablet).",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Oral feeding",
"       </td>",
"       <td>",
"        <span style=\"font-family: verdana,sans-serif; font-size: 10pt;\">",
"         To prevent the development of feeding aversion, infants should be fed breast milk or formula by mouth, and transitioned to solids at an age-appropriate time, even only small amounts of feeds can be given by this route.",
"        </span>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gastric acid hypersecretion",
"       </td>",
"       <td>",
"        H2 blocker or PPI. The efficacy and dosing can be determined by measuring gastric pH and aiming for pH &gt;7.&nbsp;&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bacterial overgrowth&nbsp;",
"       </td>",
"       <td>",
"        Monitor D-lactate level, urine indicans, and glucose breath hydrogen. If positive, treat with low-dose rotating antibiotic therapy.&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Choleretic enteropathy",
"       </td>",
"       <td>",
"        Patient is at risk if terminal ileum was resected. Use bile salt sequestering agents.&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Fat soluble vitamin malabsorption",
"       </td>",
"       <td>",
"        Monitor every three months, and replace as needed. Extra vigilance is needed during the transition off of parenteral nutrition.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Vitamin and mineral malabsorption (potassium, chloride, magnesium, calcium, zinc, iron, selenium, and vitamin B12 )",
"       </td>",
"       <td>",
"        Monitor every three months, and replace as needed. Extra vigilance is needed during the transition off of parenteral nutrition.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     H2 blocker: histamine H2 receptor antagonist; PPI: proton pump inhibitor.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
