" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 572px\">",
"   <div class=\"ttl\">",
"    Dose-dependence of efficacy of atenolol in stable angina",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 552px; height: 307px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of different daily doses of atenolol (25, 50, 100, and 200 mg) in patients with stable angina. There was a tendency toward increasing efficacy with increasing dose. Only the 100 and 200 mg doses were significantly effective at trough levels with respect to exercise time and ST depression.",
